import React from 'react';
function Tabla(props) {

    return (
      <table>
        <thead>
          <tr>
            <th>Cantidad</th>
            <th></th>
            <th>Edad</th>
          </tr>
        </thead>
        <tbody>
          {props.data.map((simulacion) => (
            <tr>
              <td>{simulacion.fecha}</td>
              <td>{simulacion.producto}</td>
              <td>{simulacion.cantidad}</td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  }

  export default Tabla;
